import HeroSection from './HeroSection/HeroSection';

const HomePage = () => {
	return (
		<div>
			<HeroSection />
			<div className="row">
				<div style={{ width: '100%', background: 'red', height: '200px' }}></div>
				<div style={{ width: '100%', background: 'red', height: '200px' }}></div>
			</div>
		</div>
	);
};

export default HomePage;
